css:
.highlight.uncovered .region {
  background-color: #cc3e44;
  opacity: 0.2;
}
.highlight.covered .region {
  background-color: #8dc149;
  opacity: 0.2;
}
.line-number.uncovered {
  color: #519aba !important;
  background-color: #cc3e44;
}
.line-number.covered {
  color: #519aba !important;
  background-color: #8dc149;
}
